import React from 'react';

import { connect } from 'react-redux';
import { setLoginModalWindow } from '../../redux/actions';

import './auth.css';

const Auth = ({ setLoginModalWindow }) => {

    const handleLoginButtonClick = (e) => {
        e.preventDefault();
        setLoginModalWindow(true);
    }

    return (
        <ul className="auth-list">
            <li className="auth-list__item auth-list__item--log">
                <a className="auth-list__link"
                    href=""
                    onClick={handleLoginButtonClick}>Вход</a>
            </li>
            <li className="auth-list__item auth-list__item--reg">
                <a className="auth-list__link" href="">Регистрация</a>
            </li>
        </ul>
    )
}

export default connect(null, { setLoginModalWindow })(Auth);
